@elisadavis5704 Narrated Abu 'Amir or Abu Malik Al-Ash'ari:
that he heard the Prophet (ï·º) saying, "From among my followers there will be some people who will consider illegal sexual intercourse, the wearing of silk, the drinking of alcoholic drinks and the use of musical instruments, as lawful. And there will be some people who will stay near the side of a mountain and in the evening their shepherd will come to them with their sheep and ask them for something, but they will say to him, 'Return to us tomorrow.' Allah will destroy them during the night and will let the mountain fall on them, and He will transform the rest of them into monkeys and pigs and they will remain so till the Day of Resurrection."
Most of the big scholar stated that music is haram whereas  listening to the lyrics is haram or halal is controversial.
